import { Route, Switch } from "react-router"



export default function renderRouters(routers) {
    return <Switch>
        {
            routers.map(e => {

                let { exact, path, component } = e
                return <Route exact={exact} path={path} component={component} />
            })
        }
    </Switch>

}
